import axios from "axios";

export const fetchCharacters = async() => {
    try {
      const result = await axios.get(`https://rickandmortyapi.com/api/character`);
      console.log("result", result.data.results);
      return result.data;
    } catch (error) {
      // console.log(error);
    }
  };


